import React, { useEffect } from 'react';
import '../mycss/Header.css'; // Import the CSS file for header styles
import logoImage from '../assets/jayce1.png';

function Header() {
  useEffect(() => {
    const hamburgerButton = document.querySelector('.hamburger-button');
    if (hamburgerButton) {
      hamburgerButton.addEventListener('click', function () {
        const navLinks = document.querySelector('.nav-links');
        if (navLinks) {
          navLinks.style.display = (navLinks.style.display === 'none') ? 'block' : 'none';
        }
      });
    }
  }, []);

  return (
    <header>
      <div className="container">
        <img src={logoImage} alt="mylogo" width="150" />
        <div className="title">Jayce Turambe</div>
        <div className='hamburgermenu'>
          <button className='hamburger-button'> â˜° </button>
          <div className='nav-links'>
            <a href="#profile">Profile</a>
            <a href="#projects">Projects</a>
            <a href="#about">About</a>
            <a href="#contact">Contact</a>
          </div>
        </div>
      </div>
    </header>
  );
}

export default Header;
